def normalize(text):
    return text.strip()\
        .replace(u"\xe9", "e")\
        .replace(u"\xe8", "e")\
        .replace(u"\xea", "e")\
        .replace(u"\xe0", "a")\
        .replace(u"\xe2", "a")\
        .replace(u"\xef", "i")\
        .replace(u"\xf4", "o")\
        .replace(u"\xe7", "c")\
        .replace(u"\u0153", "oe")\
        .replace(u"\xc9", "E")\
        .replace(u"\u2640", " F")\
        .replace(u"\u2642", " M")\
        .replace(u"\u2014", "")

